// src/pages/Profile.js
import React from 'react';
import { useAuth } from '../contexts/AuthContext';

const Profile = () => {
  const { user } = useAuth();

  return (
    <div className="min-h-screen bg-background text-text">
      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <div className="px-4 py-6 sm:px-0">
          <h1 className="text-2xl font-semibold mb-6">Profile</h1>
          <div className="bg-surface shadow overflow-hidden sm:rounded-lg p-6">
            <div className="mb-4">
              <h2 className="text-lg leading-6 font-medium">Name</h2>
              <p className="mt-1 text-sm text-gray-600">{user?.name}</p>
            </div>
            <div className="mb-4">
              <h2 className="text-lg leading-6 font-medium">Email</h2>
              <p className="mt-1 text-sm text-gray-600">{user?.email}</p>
            </div>
            {/* Add other profile details here */}
          </div>
        </div>
      </main>
    </div>
  );
};

export default Profile;
